import React from "react";
import "./style.css";
import { Images } from "../../config/image";
function Component_NgangHong() {
  return (
    <div>
      <div className="box-3">
        <div style={{ display: "block" }}>
          <div style={{ display: "flex", justifyContent: "center" }}>
            <img src={Images.REVIEW} />
          </div>
          <div style={{ display: "flex", justifyContent: "center" }}>
            <div className="topic-com-2"> Cơ sở vật chất </div>
          </div>
            <div style={{display:"flex",justifyContent:"center"}}>
            <div  className="content-com-2">
              Chủ trọ có thể quản lý nhà trọ mọi lúc mọi nơi, dữ liệu được quản lý tập trung, bảo mật, và an toàn tuyệt đối.
            </div>
            </div>
        </div>
      </div>
    </div>
  );
}

export default Component_NgangHong;
